Given the following program, identify all intermediate or unused variables (it can be a global variable, local variable, function parameter, etc.). Please write the identified variable names into a json: {'target_list': [a list of variable names]}. If no variable is identified, just give an empty list.. The program is use std::collections::VecDeque;

fn main() {
    let mut new_variable: VecDeque<u8> = VecDeque::with_capacity(32);
    new_variable.push_front(7);
    new_variable.push_front(6);
    new_variable.push_front(5);
    new_variable.push_front(4);
    new_variable.push_front(3);
    new_variable.push_front(2);
    new_variable.push_front(1);
    new_variable.push_front(0);
    new_variable.reserve(24);
    println!();
    new_variable.push_back(0xD9);
}
